css:
@-moz-document domain("astra.si") {
.header-outer:not(.grey-b) {
	background-color: #000000;
}

#primary-nav .nav li a {
	color: #999999;
}

.single .outer.grey-ed {
	background-color: #000000;
}

.outer.grey-ed {
	background-color: #323232;
	color: #ffffff;
}

.grey-b {
	background-color: #323232;
}

.paypal-left {
	color: #ffffff;
}

.paypal-left strong {
	color: #438BC5;
}

.paypal-right input[src] {
	background: #323232 !important;
	border-radius: 18px;
}

.paypal-right img {
	visibility: hidden;
}

.grey-e {
	background-color: #323232;
	color: #ffffff;
}

.grey-do {
	background-color: #999999;
}

#secondary-navigation li a {
	background-color: #323232 !important;
}

#secondary-nav .nav li a:hover,
#secondary-nav .nav li.sfHover a {
	background-color: #15395d !important;
}

.entry-title a:link,
.entry-title a:visited {
	color: #ffffff;
}

.entry-list h2 a {
	height: auto;
	margin-bottom: 25px;
}

.banner-ad-video {
	display: none;
}

.entry-content,
.entry-embed {
	width: 100% !important;
}
}
